import React from "react";
import { Link } from "react-router-dom";
import DashBoardHader from "../dashBoardHader";
function DashBoard() {
  return (
    <div>
      <DashBoardHader />
      <h1 className="mt-4">Salahuddin</h1>
      <p className="lead mb-3">Welcome </p>
      <Link to="/logout" className="btn btn-secondary">
        Logout
      </Link>
    </div>
  );
}

export default DashBoard;
